import React from 'react';

import './App.css';
import { Brand, Feature, Navbar} from './components';
import { Footer, Features, Header} from './containers';

const App = () => (
    <div className="App">
     <div className="gradient__bg">
        <navbar />
        <header />
      </div>
      <brand />
      <features />
      <footer />

    </div>
  );

export default App;
